import React from "react";

const FilterForm = ({ handleFilterList }) => {
  return (
    <div>
      <span>キーワード絞り込み</span>
      <form action="">
        <input
          type="text"
          placeholder="検索したいワードを入力してください"
          onChange={() => handleFilterList()}
        />
      </form>
    </div>
  );
};

export default FilterForm;
